"use strict";(self.webpackChunktech_doc_samples=self.webpackChunktech_doc_samples||[]).push([[698],{9054:e=>{e.exports=JSON.parse('{"blogPosts":[{"id":"gh-pages-deploy-error","metadata":{"permalink":"/tech-doc-samples/blog/gh-pages-deploy-error","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2023-05/01-gh-pages-deploy-error.md","source":"@site/blog/2023-05/01-gh-pages-deploy-error.md","title":"GitHub Pages deployment error: Permission denied to github-actions[bot]","description":"While following the instructions for Triggering deployment with GitHub Actions for this Docusaurus website, I ran into this error:","date":"2023-05-18T00:00:00.000Z","formattedDate":"May 18, 2023","tags":[{"label":"github","permalink":"/tech-doc-samples/blog/tags/github"},{"label":"deployment","permalink":"/tech-doc-samples/blog/tags/deployment"},{"label":"docusaurus","permalink":"/tech-doc-samples/blog/tags/docusaurus"},{"label":"github actions","permalink":"/tech-doc-samples/blog/tags/github-actions"},{"label":"automations","permalink":"/tech-doc-samples/blog/tags/automations"}],"readingTime":0.515,"hasTruncateMarker":false,"authors":[{"name":"Mauro Meden","title":"Technical Analyst","url":"https://github.com/maurom88","imageURL":"https://github.com/maurom88.png","key":"mauro"}],"frontMatter":{"slug":"gh-pages-deploy-error","title":"GitHub Pages deployment error: Permission denied to github-actions[bot]","date":"2023-05-18T00:00:00.000Z","authors":["mauro"],"tags":["github","deployment","docusaurus","github actions","automations"]}},"content":"While following the instructions for [Triggering deployment with GitHub Actions](https://docusaurus.io/docs/deployment#triggering-deployment-with-github-actions) for this Docusaurus website, I ran into this error:\\n\\n```\\n/usr/bin/git push origin gh-pages\\nremote: Permission to maurom88/tech-doc-samples.git denied to github-actions[bot].\\nfatal: unable to access \'https://github.com/maurom88/tech-doc-samples.git/\': The requested URL returned error: 403\\nError: Action failed with \\"The process \'/usr/bin/git\' failed with exit code 128\\"\\n```\\n\\nFortunately, a little googling brought me to [this solution](https://github.com/actions/checkout/issues/417#issuecomment-1383515952), which pointed me in the right direction:\\n\\n`Settings > Actions > General > Workflow permissions > Read and write permissions`\\n\\nAfter updating this setting, I was able to push a new commit and have the changes deployed automatically. Neat!"}]}')}}]);